const userSessionCookie = 'upayogakarta';
const rememberUserCookie = 'yaadrakhna';

const FOOTPRINTS_ROUTES = {
  LOGIN: '/login',
  DASHBOARD: '/dashboard',
  FORGOT_PASSWORD: '/forgot-password',
  PASSWORD_RESET: '/password-reset/:token',
  ANALYTICS: '/analytics',
  ORG_UNITS: '/org-units',
  USERS: '/users',
  ASSETS_TYPE: '/asset-types'
};

export { userSessionCookie, rememberUserCookie, FOOTPRINTS_ROUTES };
